insert into configuration (configuration_id, configuration_title, configuration_key, configuration_value, configuration_description, configuration_group_id, sort_order, last_modified, date_added, use_function, set_function) values ('3843', 'Resampling', 'THUMBNAIL_USE_RESAMPLING', 'true', 'Ustawienie tej wartoci na true powoduje uycie resamplingu (transformacja bitmapy polegajca na zmianie liczby jej pikseli) w wyniku czego miniaturki maj lepsz jakoS. (funkcja ta jest niedostepna w biblitece GD < 2.0.1)', '100', '0', NULL, '2007-05-17 10:54:12', NULL, 'tep_cfg_select_option(array(\'true\', \'false\'),');
