insert into pages_description (id, pages_id, pages_title, pages_html_text, intorext, externallink, link_target, language_id) values ('13', '4', 'Polityka prywatnoci', '<p style=\"text-align: justify;\"><span style=\"font-size: medium; color: #ff6600;\"><strong>Czym s ciasteczka (cookie):</strong></span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">W  brew nazwie ciasteczka te nie su do jedzenia lecz s to mae pliki  najczciej tekstowe umieszczane automatycznie przez serwer na  urzdzeniu kocowym (komputerze, smartfonie itp.). Pliki te pozwalaj na  przechowanie istotnych danych o dziaaniu strony oraz wywietlanych  informacjach.<br />
cookie zawieraj za zwyczaj dane takie jak: nazw strony z ktrej pochodz, unikalny numer i inne dane informacyjne.&nbsp;</span></span></span></p>
<p style=\"text-align: justify;\">&nbsp;<span style=\"font-size: medium; color: #ff6600;\"><strong>Jakie s rodzaje ciasteczek:</strong></span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: xx-small;\"><span style=\"font-size: small;\">Rozrniamy dwa podstawowe rodzaje: ciasteczko sesji, i ciasteczka stae.<br />
Ciasteczka sesji uywane s tylko w czaje jednej sesji uytkownika, po opuszczeniu strony ulegaj przedawnieniu i s tracone.&nbsp;<br />
Ciasteczko stae umieszczane jest na z gry okrelony okres czasu na jaki jego dane mog by przydatne np. godzin, dzie, rok.&nbsp;</span></span></span></span></p>
<p style=\"text-align: justify;\">&nbsp;<span style=\"color: #ff6600;\"><strong><span style=\"font-size: medium;\">Do czego uywa si ciasteczek:</span></strong></span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: xx-small;\"><span style=\"font-size: small;\">Ciasteczka  s bardzo przydatne, uywane s w rnych celach jak np:  statystycznych, marketingowych, identyfikacyjnych, magazynujcych dane.<br />
Przykadowo  wchodzc na stron sklepu internetowego w trakcie wykonywania zakupw  dane o produktach woonych do koszyka przechowywane s wanie w  ciasteczku. Dziki takiemu rozwizaniu oprogramowanie sklepu wie co  kupujemy i moe zidentyfikowa danego uytkownika. take dane o tym e  jestemy zalogowani i jako kto przechowywane s w ciasteczku. Inne  strony mog przechowywa dane o wywietlanej reklamie np. po to eby  pamita ktre reklamy ju widzielimy.<br />
Take dane statystyczne mog  by przechowywane w cookies mwi nam o tym kiedy ostatnio logowalimy  si i jakie strony odwiedzalimy w ramach tego serwisu.<br />
Jednym z  czciej spotykanych ciasteczek s ciasteczka&nbsp;uywane przez Google  Analytics przechowuj one dane ktre pomagaj w analizie strony.</span></span></span></span></p>
<p style=\"text-align: justify;\">&nbsp;<span style=\"color: #ff6600; font-size: medium;\"><strong>Jak wyczy ciasteczka i jak je usun:</strong></span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Kada  przegldarka umoliwia wyczenie ciasteczek, jednak trzeba pamita e  wyczajc ciasteczko moemy si pozbawi pewnych przydatnych funkcji  strony a niektre z nich mog nie prawidowo dziaa np. moe si okaza  e nie moemy wykona zakupw w sklepie Internetowym, lub s problemy z  zalogowaniem na swoje konto itp.</span></span></span></p>
<p style=\"text-align: justify;\"><strong><span style=\"color: #000000; font-size: small;\">Wyczenie ciasteczek w Internet Explorer:<br />
</span></strong><span style=\"color: #000000; font-size: small;\">Kliknij</span><strong><span style=\"color: #000000; font-size: small;\"> Narzdzia </span></strong><span style=\"color: #000000; font-size: small;\">a nastpnie</span><strong><span style=\"color: #000000; font-size: small;\"> Opcje internetowe. </span></strong><span style=\"color: #000000; font-size: small;\">W nowo otwartym oknie wybierz zakadk <strong>Prywatno</strong> i kliknij <strong>zaawansowane</strong>. Wcz opcje <strong>zastp automatyczn obsug plikw cookie</strong>&nbsp;i ustaw reszt zgodnie z twoimi oczekiwaniami.</span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000; font-size: small;\"><strong><span>Wyczenie ciasteczek w Operze:<br />
</span></strong></span><span style=\"font-size: small;\">Wejd w</span><strong style=\"font-size: small;\"> Narzdzia </strong><span style=\"font-size: small;\">a nastpnie</span><strong style=\"font-size: small;\"> Ustawienia. </strong><span style=\"font-size: small;\">W nowo otwartym oknie wybierz </span><strong style=\"font-size: small;\">cookie </strong><span style=\"font-size: small;\">&nbsp;i ustaw reszt zgodnie z twoimi oczekiwaniami.</span></p>
<p style=\"text-align: justify;\"><span style=\"color: #000000; font-size: small;\"><strong>Wyczenie ciasteczek w FireFox:<br />
</strong></span><span style=\"font-size: small;\">Wejd w</span><strong style=\"font-size: small;\"><strong>&nbsp;Narzdzia&nbsp;</strong></strong><span style=\"font-size: small;\">a nastpnie</span><strong style=\"font-size: small;\"><strong>&nbsp;Opcje.&nbsp;</strong></strong><span style=\"font-size: small;\">W nowo otwartym oknie wybierz&nbsp;</span><strong style=\"font-size: small;\"><strong>Prywatno&nbsp;</strong></strong><span style=\"font-size: small;\">&nbsp;i ustaw reszt zgodnie z twoimi oczekiwaniami.</span></p>
<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><strong>Wyczenie ciasteczek w Chromie:<br />
</strong></span><span style=\"font-size: small;\">Wejd w</span><strong style=\"font-size: small;\"><strong>&nbsp;(trzy paseczki w prawym grnym rogu)&nbsp;</strong></strong><span style=\"font-size: small;\">a nastpnie</span><strong style=\"font-size: small;\"><strong>&nbsp;Ustawienia.&nbsp;</strong></strong><span style=\"font-size: small;\">W nowo otwartym oknie wybierz&nbsp;znowu <strong>U</strong></span><strong style=\"font-size: small;\"><strong>stawienia </strong></strong><span style=\"font-size: small;\">na dole strony kliknij w link</span><strong style=\"font-size: small;\"><strong>&nbsp;Poka ustawienia zaawansowane...</strong></strong><span style=\"font-size: small;\">&nbsp;rozwinie si wtedy dodatkowe menu. Nastpnie znajd i kliknij w przycisk </span><strong style=\"font-size: small;\">Ustawienia treci</strong><span style=\"font-size: small;\"> w dziale </span><strong style=\"font-size: small;\">prywatno</strong><span style=\"font-size: small;\"> i ustaw reszt zgodnie z twoimi oczekiwaniami.</span></p>', '0', '', '0', '1');
