insert into pages_description (id, pages_id, pages_title, pages_html_text, intorext, externallink, link_target, language_id) values ('17', '5', 'Regulamin', '<br />
Regulamin sklepu internetowego rattanland.pl<br />
<br />
Rozdzia I Postanowienia oglne<br />
<br />
&sect; 1<br />
<br />
Niniejszy regulamin stanowi akt normatywny, w ktrym zawarto zasady wiadczenia usug sklepu internetowego rattanland.pl, sposb oraz warunki zawierania w ramach serwisu transakcji. Regulamin stworzony zosta na podstawie ustawy z dnia 18 lipca 2002 roku o wiadczeniu usug drog elektroniczn (Dz. U., Nr 144, poz. 1204 ze zmianami).<br />
<br />
&sect; 2<br />
<br />
Sklep internetowy, znajdujcy si na stronie internetowej pod adresem www.rattanland.pl umoliwia dokonywanie zakupw za porednictwem Internetu<br />
<br />
&sect; 3<br />
<br />
Sklep rattanland.pl jest prowadzony przez firm:<br />
Rattanlad Sp z o.o.<br />
ul.Pogodna 8<br />
66-470 Kostrzyn nad Odr<br />
KRS 0000457389<br />
NIP 5993166003<br />
REGON 081120110<br />
<br />
&sect; 4<br />
<br />
Kontakt telefoniczny z sklepem oraz hurtowni moliwy jest od poniedziaku do pitku w godzinach 9:30 - 17:30. Natomiast kontakt drog elektroniczn dostpny przez ca dob.<br />
<br />
&sect; 5<br />
<br />
Zakup w sklepie internetowym rattanland.pl oznacza akceptacj niniejszego regulaminu.<br />
<br />
&sect; 6<br />
<br />
Ilekro w regulaminie jest mowa o:<br />
<br />
1.&nbsp;&nbsp;&nbsp; Uytkownik - podmiot, ktry wyrazi ch korzystania z usug serwisu rattanland.pl dokonujc rejestracji swojej osoby w systemie serwisu<br />
<br />
2.&nbsp;&nbsp;&nbsp; Sprzedajcy - naley przez to rozumie podmiot rattanland.pl;<br />
<br />
3.&nbsp;&nbsp;&nbsp; Kupujcy &ndash; uytkownik serwisu rattanland.pl, ktry w oparciu o czynnoci techniczne przyj ofert sprzeday towaru;<br />
<br />
4.&nbsp; Konto - indywidualny panel administracyjno-informacyjny Kupujcego, ktry tworzy si automatycznie w skutek prawidowej rejestracji. W panelu tym gromadzone oraz przechowywane s informacje dotyczce uprzednio zoonych zamwie kupujcego oraz podanych prze niego podczas rejestracji danych osobowych;<br />
<br />
5.&nbsp;&nbsp;&nbsp; Koszyk - narzdzie systemowe umoliwiajce Kupujcemu, zarwno dokonywanie zakupw, gromadzenie wybranych ofert w jednym miejscu, jak rwnie podgld ich wartoci. Tworzony automatycznie w wyniku &bdquo;kliknicia&rdquo; opcji &bdquo;do koszyka&rdquo; przynajmniej jednego towaru. Samo wybranie opcji &bdquo;do koszyka&rdquo; nie stanowi przyjcia oferty czy potwierdzenia jej otrzymania i nie jest wice. W kadej chwili uytkownik moe usun z koszyka kady wybrany wczeniej towar;<br />
<br />
6.&nbsp;&nbsp;&nbsp;&nbsp; Towar - rozumiany jako rzecz, usuga, ktre mog by przedmiotem oferty sprzeday, zgodnie z Regulaminem;<br />
<br />
Rozdzia II Oferta<br />
<br />
&sect; 7<br />
<br />
Wszystkie artykuy oferowane przez Sklep Internetowy rattanland.pl s nowe i objte gwarancj.<br />
<br />
&sect; 8<br />
<br />
Wszystkie ceny w Sklepie Internetowym rattanland.pl s cenami brutto i zawieraj 23% podatku VAT. Na wszystkie towary wystawiony zostanie paragon bd faktura VAT zgodnie z preferencjami kupujcego. Jednak, aby otrzyma faktur VAT naley poprawnie wprowadzi dane przedsibiorstwa wraz z numerem NIP.<br />
<br />
&sect; 9<br />
<br />
Cen kocow otrzymuj Pastwo w mailu potwierdzajcym przyjcie zamwienia, ktra jest powikszona o koszty transportu. Te mog ulec zmianie w zalenoci od iloci zamwionego towaru, o czym klient bdzie poinformowany take drog elektroniczn.<br />
<br />
Rozdzia III Zasady skadania i realizacji zamwie<br />
<br />
&sect; 10<br />
<br />
Dodanie produktu do koszyka, a nastpnie uycie przycisku &quot;Zamwienie&quot; inicjuje proces skadania zamwienia. Aby mona byo poprawnie przeprowadzi procedur zamwienia nie jest konieczne zakadanie konta uytkownika. Jednak w przypadku zaoenia konta uytkownika mona skorzysta z dodatkowych usug min. obserwowa status realizacji oraz warto zamwienia. Podstaw realizacji zamwienia jest poprawne wypenienie formularza znajdujcego si w kocowym etapie skadania zamwienia. Wymagane jest prawidowe wypenienie wszystkich wymaganych pl formularza.<br />
<br />
&sect; 11<br />
<br />
Zamwienie mona skada 24 godziny na dob przez cay rok. Zamwienia zoone w soboty, niedziele czy wita bd rozpatrywane pierwszego dnia roboczego.<br />
<br />
&sect; 12<br />
<br />
Wszelkie zamwienia weryfikowane s telefonicznie bd mailowo. W przypadku braku kontaktu z zamawiajcym w cigu 3 dni roboczych zamwienie zostanie anulowane. Zamwienie uwaa si za przyjte w momencie potwierdzenia telefonicznego lub mailowego.<br />
<br />
&sect; 13<br />
<br />
Towar wysyany jest po zaksigowaniu patnoci za towar na naszym rachunku bankowym.<br />
<br />
&sect; 14<br />
<br />
Skadajc zamwienie w Sklepie Internetowym rattanland.pl kupujcy owiadcza e zapozna si z niniejszym regulaminem i akceptuje jego warunki.<br />
<br />
&sect; 15<br />
<br />
Rattanland.pl zastrzega sobie prawo do wstrzymania zamwie wzbudzajcych wtpliwoci, np. w ktrych nieprawidowo wypeniono dane teleadresowe lub w przypadku brak numeru telefonu czy nieistniejcego adresu e-mail.<br />
<br />
Rozdzia IV Formy patnoci<br />
<br />
&sect; 16<br />
<br />
Serwis rattanland.pl przewiduje nastpujce formy patnoci:<br />
<br />
&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; gotwka przy odbiorze wasnym;<br />
<br />
&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; przelew na rachunek bankowy sklepu przed realizacj zamwienia. Numer rachunku w celu dokonania patnoci zostanie wysane wraz z wiadomoci email potwierdzajc zamwienie;<br />
<br />
&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; za pobraniem patno nastpuje w momencie dostarczenia paczki z towarem.<br />
<br />
&nbsp;<br />
<br />
Rozdzia V Reklamacje i zwroty towaru<br />
<br />
&sect; 17<br />
<br />
W myl ustawy z 2 marca 2000 roku o ochronie niektrych praw konsumentw oraz o odpowiedzialnoci za szkod wyrzdzon przez produkt niebezpiecznym (Dz. U. z 2000r. Nr 22, poz. 271 z p, zm.) kupujcemu bdcemu konsumentem przysuguje prawo do odstpienia od zawartej umowy sprzeday, w terminie 10 dni od daty dostarczenia towaru bez podania przyczyn.<br />
<br />
&sect; 18<br />
<br />
W przypadku otrzymania produktu posiadajcego ukryte wady techniczne lub powstae podczas dostawy kupujcy ma prawo do zoenia reklamacji. Zgoszenie reklamacyjne musi zawiera dokadny opis ujawnionych wad, dokadne oznaczenie sprzedajcego produkt oraz dane nabywcy produktu. W przypadku zgaszania uszkodzenia produktu na odlego do opisu zgoszenia doczy naley zdjcia, najlepiej e-mailem w wersji elektronicznej.<br />
<br />
&sect; 19<br />
<br />
Wadliwy towar naley odesa w przecigu 14 dni od daty otrzymania produktu wraz z opisem przyczyn reklamacji.<br />
<br />
&sect; 20<br />
<br />
Towar naley zwrci w oryginalnym, nieuszkodzonym opakowaniu wraz z ca jego zawartoci oraz zaczonym dowodem zakupu. Klient obligowany jest do zwrotu towaru wskazujcym na brak jego uytkowania. Reklamowany towar winien by czysty w stanie jaki go klient otrzyma w momencie zakupu.<br />
<br />
&sect; 21<br />
<br />
Sprzedawca poinformuje zgaszajcego o sposobie rozpatrzenia zgoszenia reklamacyjnego w terminie 14 dni od daty jego otrzymania.<br />
<br />
&sect; 22<br />
<br />
Sklep internetowy rattanland.pl ma prawo nie przyj do reklamacji towaru, ktry nie spenia w/w warunkw. Przesyki wysyane na koszt serwisu nie bd odbierane.<br />
<br />
&sect; 23<br />
<br />
Rwnowarto odesanego towaru wynikajcego z zamwienia nastpi w przecigu 14 dni roboczych od daty przyjcia towaru przez Serwis rattanland.pl. Nalenoci zostan przekazane przelewem na rachunek bankowego klienta. Koszty wysyki/transportu zwrotu towaru w caoci pokrywa klient.<br />
<br />
&nbsp;<br />
<br />
Rozdzia VI Ochrona danych osobowych<br />
<br />
&sect; 24<br />
<br />
Kupujcy skadajc zamwienie wyraa zgod na przetwarzanie danych osobowych przez sklep internetowy Rattanland.pl w celu, zarwno realizacji zamwienia, jak i w celach marketingowych<br />
<br />
&sect; 25<br />
<br />
Kady klient, ktrego dane znajduj si w bazie danych ma prawo do ich wgldu poprawiania czy usuwania.<br />
<br />
&sect; 26<br />
<br />
Dane przechowywane s z najwysz starannoci i odpowiednio chronione przed dostpem do nich osb nieupowanionych w myl ustawy z dnia 29 sierpnia 1997 r. o ochronie danych osobowych (Dz. U. z 1997roku Nr 133 poz. 883)<br />
<br />', '0', '', '0', '1');
