insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('1', '1', 'Baltic krzeso skadane (5 pozycji)', '<h2 style=\"text-align: justify;\">Krzeso skadane Baltic</h2>
<div style=\"text-align: justify;\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">Krzeso skadane BALTIC dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">Wymiary kartonu w mm: 935x595x155</div>
<div style=\"text-align: justify;\">W kartonie znajduje si 1 krzeso.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\"><b>Moliwo dokupienia:</b></div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">- poduch do siedzenia</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\"><b>Koszty wysyki :</b></div>
<div style=\"text-align: justify;\">- kurierem po wpacie na konto</div>
<div style=\"text-align: justify;\">* 1 krzeso 20z</div>
<div style=\"text-align: justify;\">* 2 krzesa 25z</div>
<div style=\"text-align: justify;\">* kade kolejne 2szt. 25zl</div>
<div style=\"text-align: justify;\">- przesyka kurierem za pobraniem dodatkowo 10z</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<h3 style=\"text-align: justify;\">Dlaczego eukaliptus?</h3>
<h3>
<p style=\"font-size: 12px; font-weight: normal; text-align: justify;\" class=\"MsoNormal\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</p>
</h3>
