</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Cayenne krzeso skadane. Wysokiej jakoci krzeso. Wykonane z cennego rodzaju drewna eukaliptusa. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Krzeso skadane CAYENNE dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Dopracowane w kadym szczegle. Bardzo komfortowe. Krzeso skadane.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Wymiary kartonu w mm:</b> 1080x395x215</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">W kartonie znajduj si 2 krzesa.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Koszty wysyki:</b></span></div>
