<p class=\"MsoNormal\" style=\"MARGIN: 0cm 0cm 10pt\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</p>
<p class=\"MsoNormal\" style=\"MARGIN: 0cm 0cm 10pt\">Krzeso skadane WELLINGTON dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</p>
<p class=\"MsoNormal\" style=\"MARGIN: 0cm 0cm 10pt\"><b>Wymiary kartonu w mm:</b> 935x595x155</p>
<p class=\"MsoNormal\" style=\"MARGIN: 0cm 0cm 10pt\"><b>Moliwo dokupienia:</b></p>
<p class=\"MsoNormal\" style=\"MARGIN: 0cm 0cm 10pt\">&nbsp;- poduch do siedzenia</p>
<span style=\"font-size: small;\"> <b>Koszty wysyki :</b><br />
- kurierem po wpacie na konto<br />
* 1 krzeso 20z<br />
* 2 krzesa 25z<br />
* kade kolejne 2szt. 25zl<br />
- przesyka kurierem za pobraniem dodatkowo 10z<br />
</span></div>
<h3>&nbsp;<b style=\"font-family: Verdana; font-size: small;\">Dlaczego eukaliptus?</b></h3>
<div style=\"MARGIN: 0cm 0cm 10pt\"><span style=\"font-size: small;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne.<br />
