insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('8', '1', 'Bengali krzeso skadane', '<h2 style=\"text-align: justify;\">Krzeso skadane Bengali</h2>
<div style=\"text-align: justify;\">Bengali krzeso skadane. Wysokiej jakoci krzeso. Wykonane z cennego rodzaju drewna eukaliptusa. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno.&nbsp;</div>
<div style=\"text-align: justify;\">Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">Krzeso skadane BENGALI dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">Dopracowane w kadym szczegle. Bardzo komfortowe. Krzeso skadane.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\"><b>Wymiary kartonu w mm:</b> 1120x415ax280</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\">W kartonie znajduj si 2 krzesa.</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<div style=\"text-align: justify;\"><b>Koszty wysyki :</b></div>
<div style=\"text-align: justify;\">- kurierem po wpacie na konto</div>
<div style=\"text-align: justify;\">* 2 krzesa 20z</div>
<div style=\"text-align: justify;\">* 4 krzesa 40z</div>
<div style=\"text-align: justify;\">* kade kolejne 2szt. 20zl</div>
<div style=\"text-align: justify;\">- przesyka kurierem za pobraniem dodatkowo 10z</div>
<div style=\"text-align: justify;\">&nbsp;</div>
<h3 style=\"text-align: justify;\">Dlaczego eukaliptus?</h3>
<h3>
<p class=\"MsoNormal\" style=\"font-size: 12px; font-weight: normal; text-align: justify;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</p>
</h3>
<h4 style=\"text-align: justify;\"><span style=\"font-size: 13.5pt;\">Klasy twardoci drewna wedug Brinella</span></h4>
<h3>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt;\">
<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">
    <tbody>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><b>Klasa</b></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><b>Wspczynnik Brinella</b></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><b>Przykadowe gatunki</b></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">I</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">BNH &lt; 2,0</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">sosna</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">II</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">BNH 2,1 - 3</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">olcha, brzoza, klon europejski</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">III</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">BNH 3,1 - 4</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">czerenia, maho, orzech amerykaski, sapella, iroko, teak, winia, db, db czerowny, buk, jesion</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">IV</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">BNH &gt; 4,1</p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\">drzewo rane, doussie, palisander,&nbsp;<strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</p>
            </td>
        </tr>
    </tbody>
</table>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><b>I &ndash; drewno mikkie</b></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><b>II &ndash; drewno redniej twardoci</b></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><b>III &ndash; drewno twarde</b></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><b>IV &ndash; bardzo twarde drewno</b></p>
</div>
<div style=\"font-size: 12px; font-weight: normal; text-align: justify; margin: 0cm 0cm 10pt;\"><b><span style=\"font-size: 10pt;\">Nasze meble wykonane s z drewna certyfikowanego FSC</span></b><span style=\"font-size: 10pt;\">.</span></div>
<div style=\"font-size: 12px; font-weight: normal; text-align: justify; margin: 0cm 0cm 10pt;\">&nbsp;</div>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt; text-align: justify;\"><span style=\"font-size: 10pt;\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></div>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt; text-align: justify;\"><span style=\"font-size: 10pt;\">Meble s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></div>
</h3>', '', '', '109', 'Bengali krzeso skadane', 'Wysokiej klasy skadane krzeso drewniane Bengali wykonane z rattanu, technorattanu lub eukaliptusa. Zapraszamy!', 'Krzesa ogrodowe, krzesa drewniane, krzesa do ogrodu, krzesa z rattanu, krzesa technorattan, krzesa eukaliptus', '');
