<h2><span style=\"font-size: large;\"><span style=\"font-family: Verdana;\">Krzeso skadane Sydney</span></span><span style=\"font-size: small;\"><span style=\"font-family: Verdana;\"><br />
</span></span></h2>
<p style=\"margin: 0cm 0cm 10pt\" class=\"MsoNormal\"><span style=\"font-size: small;\"><span style=\"font-family: Verdana;\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></span></p>
<p style=\"margin: 0cm 0cm 10pt\" class=\"MsoNormal\"><span style=\"font-size: small;\"><span style=\"font-family: Verdana;\">Krzeso skadane SYDNEY dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton. </span></span></p>
<p style=\"margin: 0cm 0cm 10pt\" class=\"MsoNormal\"><span style=\"font-size: small;\"><span style=\"font-family: Verdana;\"><b>Wymiary kartonu w mm:</b> 935x595x155</span></span></p>
<span style=\"font-size: larger;\"><span style=\"font-size: medium;\"><span style=\"font-family: Verdana;\">
<p style=\"margin: 0cm 0cm 10pt\" class=\"MsoNormal\"><span style=\"font-size: small;\"><b>Moliwo dokupienia:</b></span></p>
</span></span></span>  </span><span style=\"font-size: small;\">
<p style=\"margin: 0cm 0cm 10pt\" class=\"MsoNormal\"><span style=\"font-family: Verdana;\">- poduch do siedzenia<br />
<br />
<b>Koszty wysyki :</b><br />
- kurierem po wpacie na konto<br />
* 1 krzeso 20z<br />
* 2 krzesa 25z<br />
* kade kolejne 2szt. 25zl<br />
- przesyka kurierem za pobraniem dodatkowo 10z<br />
</span></p>
</span><span style=\"font-size: medium;\">
<h3><span style=\"font-size: large;\"><span style=\"font-family: Verdana;\">Dlaczego eukaliptus?</span></span></h3>
<p class=\"MsoNormal\" style=\"font-size: 12px; text-align: justify;\"><span style=\"font-family: Verdana;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</span></p>
<div style=\"font-size: 12px; margin: 0cm 0cm 10pt;\">
