            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">IV</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">BNH &gt; 4,1</span></p>
