            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">drzewo rane, doussie, palisander,&nbsp;<strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</span></p>
