<div class=\"opis_z_subiekta\">&nbsp;</div>
<!-- TW_OPIS_END --><!-- TW_CHAR_START -->
<div class=\"charakterystyka_z_subiekta\">
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Barbados Leak ogrodowy ze stolikiem. Wysokiej jakoci leak z regulacj oparcia. Posiada dwa kka, a take wysuwany may stolik na napoje. Cao wykonana z drzewa eukaliptusowego.<br />
Cena nie obejmuje materaca do leaka, koszt leaka z materacem w promocji 600 z (cena regularna materaca 199 z)<br type=\"_moz\" />
</span></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><strong>Wymiary kartonu w mm: 2000x680x90<br />
<br />
W kartonie znajduje si 1 leak<br />
<br />
</strong><font size=\"3\"><font face=\"Times New Roman\"><strong>Koszt wysyki 1 szt:<br />
</strong>*70 z po wpacie na konto<br />
*80 z wysyka za pobraniem</font></font></span></div>
<div style=\"margin: 0cm 0cm 10pt\"><br />
&nbsp;<b><span style=\"font-size: 10pt\">Dlaczego eukaliptus?</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne.<br />
</span>
<p class=\"MsoNormal\"><b><span style=\"font-size: 13.5pt\">Klasy twardoci drewna wedug Brinella</span></b></p>
