</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"> Edinburgh Fotel .Wysokiej jakoci fotel. Wykonany z cennego rodzaju drewna eukaliptusa. Dopracowany w kadym szczegle. Bardzo komfortowy. Istnieje moliwo dokupienia bardzo wygodnej poduszki do fotela. </span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
<b>Wymiary kartonu:</b> 920mm x 655mm x 140mm</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">W kartonie znajduje si 1 fotel.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Koszty wysyki :</b></span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- kurierem po wpacie na konto</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 1 fotel 20z</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 2 fotele 25z</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* kade kolejne 2szt. 25zl</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- przesyka kurierem za pobraniem dodatkowo 10z</span></div>
<h3 style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Dlaczego eukaliptus?</span></h3>
<h3>
<p class=\"MsoNormal\" style=\"font-size: 12px; font-weight: normal; text-align: justify;\"><span style=\"font-family: Verdana;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</span></p>
</h3>
<h4 style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 13.5pt;\">Klasy twardoci drewna wedug Brinella</span></span></h4>
<h3>
