                        Jedyny w swoim rodzaju ksztat awki Edinburgh oraz niezwykle trwae drewno eukaliptusowe sprawiaj,e awka Edinburhg jest niezwykle pikna i elegancka oraz moe posuy na wiele lat.<br />
                        Warto doda,e te awki s bardzo starannie wykonane i wykoczone oraz odporne na gnicie. Zostay stworzone po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach.<br />
                        <br />
                        Moliwo dokupienia grubych, niezwykle wygodnych poduch do siedzenia oraz rodkw konserwujcych. awka dostarczana w elementach, z zestawem montaowym (wkrty, imbus)</span></div>
                        <div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><strong>Wymiary kartonu w mm: 1860x655x105<br />
                        <br />
                        W kartonie znajduje si 1 awka. <br />
                        <br />
                        </strong><font size=\"3\" face=\"Calibri\">Koszty wysyki :<br />
                        - kurierem po wpacie na konto<br />
