<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><br />
</span><b><span style=\"font-size: 10pt\">Wymiary:</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">- dugo&nbsp;&nbsp;&nbsp; 150cm<br />
- szeroko&nbsp; 80cm</span><br />
-&nbsp; wysoko&nbsp;&nbsp;&nbsp; 75cm<br />
<br />
<strong>Koszty wysyki 1 stou:<br />
</strong>*35 z po wpacie na konto,<br />
*45 z przy wysyce za pobraniem</div>
<div style=\"margin: 0cm 0cm 10pt\">&nbsp;<b><span style=\"font-size: 10pt\">Dlaczego eukaliptus?</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. <br />
</span>
<p class=\"MsoNormal\"><b><span style=\"font-size: 13.5pt\">Klasy twardoci drewna wedug Brinella</span></b></p>
<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">
    <tbody>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
