            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\"><b>Wspczynnik Brinella</b></p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\"><b>Przykadowe gatunki</b></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">I</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH &lt; 2,0</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">sosna</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">II</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH 2,1 - 3</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">olcha, brzoza, klon europejski</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">III</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH 3,1 - 4</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">czerenia, maho, orzech amerykaski, sapella, iroko, teak, winia, db, db czerowny, buk, jesion</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">IV</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH &gt; 4,1</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">drzewo rane, doussie, palisander, <strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</p>
