</strong></span><span style=\"font-size: 10pt\"><br />
- dugo&nbsp;&nbsp;&nbsp;&nbsp; 180cm<br />
- szeroko 100cm<br />
- wysoko&nbsp;&nbsp; 75cm</span>
<div style=\"margin: 0cm 0cm 10pt\">&nbsp;</div>
