<div style=\"text-align: center; margin: 0cm 0cm 10pt\" align=\"center\"><b><span style=\"font-size: 10pt\">Nasze meble wykonane s z drewna certyfikowanego FSC</span></b><span style=\"font-size: 10pt\">.</span></div>
<div style=\"text-align: center; margin: 0cm 0cm 10pt\" align=\"center\">&nbsp;</div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Meble s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></div>', 'Birmingham st', '', '124', 'Birmingham st', 'Wysokiej klasy st drewniany Birmingham wykonany z drewna eukaliptusowego. Sprawd nasz ofert!', 'stoy ogrodowe, stoy drewniane, stoy do ogrodu, stoy z rattanu, stoy technorattan, stoy eukaliptus, stoliki rattan', '');
