</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family:Verdana;\">Zestaw New Castle to efektowny komplet mebli, idealny dla klientw, ktrzy pragn wypoczynku w luksusowo urzdzonym otoczeniu.<br />
<br />
W skad zestawu wchodzi osiem krzese i st, w ktrym poczono korpus ze sztucznego ratanu ze szklanym blatem. Mikkie poduszki doczone do zestawu sprzyjaj komfortowi podczas biesiadowania.<br />
<br />
<b>Wymiary: </b><br />
Krzeso:  45 x 48 x 100<br />
St:      180 x 75 x 77<br />
<br />
</span></div>
<h3>Dlaczego rattan?</h3>
