</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family:Verdana;\">Wewntrzny zestaw Blackbush cechuje si tradycyjnym wzornictwem poczonym z innowacyjnoci. Zestaw ten pozwoli Pastwu zim przenie klimat ogrodu czy tarasu do domowego zacisza.<br />
<br />
W skad zestawu Blackbush wchodzi sze krzese i st, w ktrym poczono korpus ze sztucznego ratanu ze szklanym blatem. Poczenie to sprawia, i st wglda solidnie i bardzo atwo mona utrzyma go w czystoci.<br />
<br />
<b>Wymiary:</b> <br />
Krzeso:  48 x 58 x 87h<br />
St:      150 x 180 x 74h<br />
<br />
<h3>Dlaczego rattan?</h3>
<div style=\"text-align: justify;\"><span style=\"font-family:Verdana;\">Oferowane przez nas meble wykonane s z litego drewna palm ratanowych oraz naturalnej plecionki z lian rattanu i trawy morskiej. Cechuje je wyjtkowa trwao oraz jako dziki precyzji rcznego wykonania.<br />
