</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family:Verdana;\">Nowoczesna forma zestawu Plumouth ujta zostaa w elegancki, lekko awangardowy ksztat. Funkcjonalny zestaw mebli pomoe zaaranowa kady zaktek domu, dziki ktremu stworzysz wygodne miejsce zapewniajce relaks przy kawie. Idealnie nadaje si nawet na may balkon.<br />
<br />
Zestaw skada si ze stou wyposaonego w szyb, ktrej gadka powierzchnia uatwi utrzymanie blatu w czystoci oraz dwch siedzisk.<br />
<br />
<b>Wymiary:</b>  132 x 66 x 45<br />
<br />
</span></div>
<h3>Dlaczego rattan?</h3>
<div style=\"text-align: justify;\"><span style=\"font-family:Verdana;\">Oferowane przez nas meble wykonane s z litego drewna palm ratanowych oraz naturalnej plecionki z lian rattanu i trawy morskiej. Cechuje je wyjtkowa trwao oraz jako dziki precyzji rcznego wykonania.<br />
