insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('53', '1', 'Cardiff  Krzeso skadane (5 pozycji)', '<h2 style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Krzeso skadane Cardiff</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Krzeso skadane CARDIFF dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Wymiary kartonu w mm:</b> 935x595x155</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Moliwo dokupienia:</b></span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- poduch do siedzenia</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Koszty wysyki :</b></span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- kurierem po wpacie na konto</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 1 krzeso 20z</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 2 krzesa 25z</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* kade kolejne 2szt. 25zl</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- przesyka kurierem za pobraniem dodatkowo 10z</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<h3 style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Dlaczego eukaliptus?</span></h3>
<h3>
<p class=\"MsoNormal\" style=\"font-size: 12px; font-weight: normal; text-align: justify;\"><span style=\"font-family: Verdana;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</span></p>
</h3>
<h4 style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 13.5pt;\">Klasy twardoci drewna wedug Brinella</span></span></h4>
<h3>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt;\">
<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">
    <tbody>
        <tr>
            <td style=\"padding: 0.75pt;\">
