            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Wspczynnik Brinella</b></span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>Przykadowe gatunki</b></span></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">I</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">BNH &lt; 2,0</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">sosna</span></p>
