            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">czerenia, maho, orzech amerykaski, sapella, iroko, teak, winia, db, db czerowny, buk, jesion</span></p>
            </td>
        </tr>
