            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">BNH &gt; 4,1</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">drzewo rane, doussie, palisander,&nbsp;<strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</span></p>
            </td>
        </tr>
    </tbody>
</table>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>I &ndash; drewno mikkie</b></span></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>II &ndash; drewno redniej twardoci</b></span></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>III &ndash; drewno twarde</b></span></p>
<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><b>IV &ndash; bardzo twarde drewno</b></span></p>
</div>
<div style=\"font-size: 12px; font-weight: normal; text-align: justify; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\"><b><span style=\"font-size: 10pt;\">Nasze meble wykonane s z drewna certyfikowanego FSC</span></b><span style=\"font-size: 10pt;\">.</span></span></div>
<div style=\"font-size: 12px; font-weight: normal; text-align: justify; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></span></div>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt; text-align: justify;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Meble s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></span></div>
</h3>', '', '', '149', 'Cardif Krzeso skadane (5 pozycji)', 'Wysokiej klasy skadane krzeso drewniane Cardiff (5 pozycji) wykonane z rattanu, technorattanu lub eukaliptusa. Zapraszamy!', 'Krzesa ogrodowe, krzesa drewniane, krzesa do ogrodu, krzesa z rattanu, krzesa technorattan, krzesa eukaliptus', '');
