<div style=\"margin: 0cm 0cm 10pt\"><b><span style=\"font-size: 10pt\">
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">awka Edinburhg 2-osobowa awka Edinburgh wykonana jest z drewna eukaliptusowego. Drewno to charakteryzuje si naturaln oleistoci co czyni je odpornym na warunki atmosferyczne.<br />
