Warto doda,e te awki s bardzo starannie wykonane i wykoczone oraz odporne na gnicie. Zostay stworzone po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w komfortowych warunkach.<br />
<br />
Moliwo dokupienia grubych, niezwykle wygodnych poduch do siedzenia oraz rodkw konserwujcych. awka dostarczana w elementach, z zestawem montaowym (wkrty, imbus)</span></div>
