<br />
<div style=\"text-align: center;\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">PROMOCJA!!!<br />
KUPUJC ZESTAW OSZCZDZASZ 400 z!!! <br />
CENA REGULARNA ZESTAWU TO 1550 z, CENA PROMOCYJNA 1150 z!!!<br />
<br type=\"_moz\" />
</span></b></div>
Wyzwalajcy temperament, geometrycznie nasycona forma zestawu kawowego RABR-007 utrzymana w jaskrawej tonacji to doskonay wybr do recepcji, jadalni, salonu czy przedpokoju. Idealnie komponuje si z typowy wystrojem neoklasycznym kreujc elegancj.<b> Dopenieniem caoci kompozycji s wygodne poduchy ze zdejmowanymi  poszewkami umoliwiajcymi pranie ich w przypadku zabrudzenia!<br />
</b><br />
<br />
&nbsp;<br />
<br />
<u><b>Wymiary:</b></u><br />
<br />
Fotel z poduszk (2szt) :<br />
- wysoko siedziska z poduch - 50cm,<br />
- wysoko cakowita - 80cm,<br />
- szeroko midzy oparciami - 76cm,<br />
- gboko siedziska - 64cm,<br />
- szeroko siedziska - 58cm<br />
<br />
St ze szklanym blatem:<br />
- rednica blatu - 71,50cm,<br />
- wysoko 62cm.<br />
<br />
<span style=\"font-size: larger;\"><u><b>Koszt wysyki caego zestawu:</b></u></span><br />
<br />
*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp; z po wpacie na konto<br />
*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 70&nbsp; z wysyka za pobraniem<br />
<br />
&nbsp;<span style=\"font-size: larger;\"><b><u>Dlaczego technorattan?</u></b></span><br />
<br />
Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.<br />
<br />
Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.<br />
<br />
Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.<br />
<br />
Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.<!--[if gte mso 9]><xml>
