<p style=\"text-align: center;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: #00b050; font-size: 12pt\">&nbsp;Zestaw&nbsp; RADS-005</span></b></p>
<p style=\"text-align: justify; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"font-family: Arial;\"><span style=\"font-size: larger;\"><span style=\"line-height: 115%;\">Geometrycznie wyrazisty i niezwykle efektowny zestaw wypoczynkowy jaki Pastwu prezentujemy to idealny komplet dla klientw o wybitnie wyrafinowanym smaku stylowym.</span></span></span></p>
<p style=\"text-align: justify; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"font-family: Arial;\"><span style=\"font-size: larger;\"><span style=\"line-height: 115%;\">Doskonale nadajcy si zarwno do ogrodu czy tarasu, ale take do uytku wewntrz pomieszcze.</span></span></span></p>
<p style=\"text-align: justify; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"font-family: Arial;\"><span style=\"font-size: larger;\"><span style=\"line-height: 115%;\">Zestaw skada si z czterech bardzo wygodnych krzese oraz dwch foteli, funkcjonalnego stou o blacie z hartowanego szka umocowanego na podstawie z plecionki oraz unikalnego regau.</span> </span></span><br />
<span style=\"font-family: Arial;\"><span style=\"font-size: larger;\">Mikkie poduszki 5 cm gruboci posiadaj poszewk z wszytym zamkiem byskawicznym  dziki czemu w razie zabrudzenia mona j zdj&nbsp; do wyprania.</span></span></p>
<p style=\"margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wymiary:</span></b></p>
<p style=\"line-height: 150%; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">St ze szkem: <span style=\"mso-spacerun: yes\">&nbsp;</span><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;</span>150 x 110 x 74</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Krzeso z oparciem.:<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>60 x 58 x 90</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Krzeso bez oparcia.:<span style=\"mso-spacerun: yes\">&nbsp;&nbsp; </span>45 x 58 x 90</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Rega:<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;</span>121 x 46 x 181</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Koszt wysyki caego zestawu:<br />
</span></b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">* <span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 220 </span>z po wpacie na konto<br />
*<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;</span><span style=\"mso-spacerun: yes\"> </span>230 z wysyka za pobraniem</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;Dlaczego technorattan?</span></b></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.</span></p>
