<p style=\"text-align: center\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: #00b050; font-size: 12pt\">&nbsp;Zestaw obiadowy RADS-022</span></b></p>
<p style=\"text-align: justify; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt\">Zestaw obiadowy dziki naturalnej barwie materiau, z jakiego zosta wykonany wnosi nie tylko ciepo, ale i pozytywne emocje podczas codziennego spoywania posikw z rodzin. W skad zestawu wchodzi st z jednolitego drewna akacjowego oraz sze pokrgych wykonanych rcznie z technorattanu krzese stoowych. Dodatkowym elementem do kadego krzesa s dwie miciutkie poduszki w kolorze kremowym. Bardzo solidnie wykonany st z drewna akacjowego o wadze 58kg!!! z pewnoci sprawdzi si na pastwa ogrodzie tarasie czy nawet w domu i posuy wiele lat.<br />
</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">&nbsp;</span></b></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Wymiary:</span></b><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\"><span style=\"mso-spacerun: yes\">&nbsp; </span>Krzeso 58 x 62 x 90</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\"><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>St<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp; </span>210 x 90 x 74 waga 58kg !!! (solidny, stabilny st)<br />
</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">&nbsp;</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Koszt wysyki caego zestawu:<br />
</span></b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">* <span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 200 </span>z po wpacie na konto<br />
*<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">210 </span>z wysyka za pobraniem</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">&nbsp;Dlaczego technorattan?</span></b></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.<br />
<br />
</span></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">Dlaczego akacja?<br />
</span></b></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'\">&nbsp;</span></b></p>
&nbsp; <span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: PL; mso-bidi-language: AR-SA\">Meble wykonane z drewna akacjowego s bardzo trwae. To twarde drewno z szybko rosncych drzew najczciej pochodzi z Dalekiego Wschodu lub Poudniowej Ameryki. Zrnicowane odcienie koloru sprawiaj, i meble z niego wykonane nabieraj ciepego wygldu. Drewno to zostao okrelone jako odpowiednie do wytwarzania mebli, nieruchomych osi pojazdw, zbw k zbatych lub klinw. Z powodu swojej twardoci, siy, braku sprystoci wykorzystywane byo przy produkcji statkw</span>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\">&nbsp;</p>
