<p style=\"text-align: center;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: #00b050; font-size: 12pt\">Zestaw obiadowy RADS-025</span></b></p>
<p style=\"text-align: justify; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt\">Niewtpliwie wdzik tych mebli wzbudzi ch spdzania wsplnych chwil jak najczciej. Zestaw skada si z okrgego stou wykonanego z jednolitego drewna akacji oraz szeciu pokrgych foteli.. Gsty splot krzese wskazuje na ich masywno oraz stabilno. Dodatkowym elementem do kadego krzesa jest poprawiajca komfort siedzenia poduszka. </span><span style=\"font-family: Arial;\"><span style=\"font-size: larger;\">Mikkie  poduszki 5 cm gruboci posiadaj poszewk z wszytym zamkiem  byskawicznym  dziki czemu w razie zabrudzenia mona j zdj&nbsp; do  wyprania.</span></span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></b></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wymiary:</span></b><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\"><span style=\"mso-spacerun: yes\">&nbsp; </span>Krzeso 62 x 62 x 85</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\"><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>St<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;</span>130 x 130 x 74</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Koszt wysyki caego zestawu:<br />
</span></b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">* <span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 170 </span>z po wpacie na konto<br />
*<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;</span><span style=\"mso-spacerun: yes\"> 180 </span>z wysyka za pobraniem</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;Dlaczego technorattan?</span></b></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.<br />
<br />
</span></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Dlaczego akacja?<br />
</span></b></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></b></p>
&nbsp; <span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL; mso-ansi-language: PL; mso-bidi-language: AR-SA\">Meble wykonane z drewna akacjowego s bardzo trwae. To twarde drewno z szybko rosncych drzew najczciej pochodzi z Dalekiego Wschodu lub Poudniowej Ameryki. Zrnicowane odcienie koloru sprawiaj, i meble z niego wykonane nabieraj ciepego wygldu. Drewno to zostao okrelone jako odpowiednie do wytwarzania mebli, nieruchomych osi pojazdw, zbw k zbatych lub klinw. Z powodu swojej twardoci, siy, braku sprystoci wykorzystywane byo przy produkcji statkw</span>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\">&nbsp;</p>
