<p style=\"text-align: center;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: #00b050; font-size: 12pt\">Zestaw </span></b><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; color: #00b050; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">RADS-094</span></b></p>
<p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt\">Niepowtarzalna linia mebli, w ktrej szczegln uwag przyciga nietypowo uksztatowana, solidna konstrukcja oparcia, a take klasa ich wykoczenia. Poprzez odpowiednie wyprofilowane krzese oraz funkcjonalny st zestaw ten zachca swoim solidnym i eleganckim wygldem do duszego biesiadowania czy te duszego delektowania si komfortem.</span></p>
<p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt\">Zestaw skada si ze stou,</span><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\"> w ktrym poczono stelarz aluminiowy malowany proszkowo na kolor biay z blatem wykonanym z drewna akacji </span><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt\">oraz szeciu krzese wyposaonych w poduszki. Poszewki na poduszki posiadaj wszyte zamki byskawiczne ktre uatwiaj ich wypranie w razie zabrudzenia.<br />
</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wymiary:</span></b><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\"><span style=\"mso-spacerun: yes\">&nbsp; </span>Krzeso 50 x 55 x 80</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\"><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>St<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;</span>140 x 90 x 70</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Koszt wysyki caego zestawu:<br />
</span></b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">* <span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>80 z po wpacie na konto<br />
*<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes\">90&nbsp; </span>z wysyka za pobraniem</span></p>
<p style=\"line-height: normal; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight: normal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;Dlaczego technorattan?</span></b></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></p>
<p style=\"text-align: justify; line-height: normal; margin: 12pt 0cm 0pt\" class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.</span></p>
<p style=\"line-height: 150%; margin-bottom: 0pt\" class=\"MsoNormal\"><span style=\"line-height: 150%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">Dlaczego akacja?<br />
</span></b></p>
<p style=\"line-height: normal; margin-bottom: 0pt\" class=\"MsoNormal\"><b><span style=\"font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL\">&nbsp;</span></b></p>
&nbsp; <span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: PL; mso-ansi-language: PL; mso-bidi-language: AR-SA\">Meble wykonane z drewna akacjowego s bardzo trwae. To twarde drewno z szybko rosncych drzew najczciej pochodzi z Dalekiego Wschodu lub Poudniowej Ameryki. Zrnicowane odcienie koloru sprawiaj, i meble z niego wykonane nabieraj ciepego wygldu. Drewno to zostao okrelone jako odpowiednie do wytwarzania mebli, nieruchomych osi pojazdw, zbw k zbatych lub klinw. Z powodu swojej twardoci, siy, braku sprystoci wykorzystywane byo przy produkcji statkw</span> <!--[if gte mso 9]><xml>
