<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Zachcamy do zakupienia eleganckich parasoli ogrodowych ,dwustronnych poduszek na krzesa oraz praktycznego mini barku Sherwood.(na naszych innych aukcjach)</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
PL\">&nbsp;</span><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
color:#2B2B2B;mso-fareast-language:PL\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></p>
<br />
Zestaw skada si z rozkadanego stou oraz 8 krzese. Cena nie zawiera poduch do krzese - moliwo zakupienia w naszym sklepie. Istnieje moliwo dokupienia dodatkowych krzese. Szczegowy opis produktw wchodzcych w skad zestawu znajduje si poniej.<br />
<br />
Opis stou Stockholm:<br />
<table cellspacing=\"0\" cellpadding=\"2\" border=\"0\">
    <tbody>
        <tr>
            <td class=\"main\">Stockholm st. <span style=\"font-size: 10pt\">Wysokiej jakoci st. Wykonany z cennego rodzaju&nbsp;drewna eukaliptusa. Dopracowany w kadym szczegle. Blat stou ma ksztat owalu, posiada otwr na parasol. Maksymalne rozoenie stou zapewni miejsce nawet dla 12 - 14 osb.</span>
            <div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><br />
            </span><b><span style=\"font-size: 10pt\">Wymiary Standardowe:<br />
            </span></b><span style=\"font-size: 10pt\"><br />
            - dugo&nbsp;&nbsp;&nbsp;&nbsp; 210cm<br />
            - szeroko 100cm<br />
            - wysoko&nbsp;&nbsp; 75cm</span></div>
            <div style=\"margin: 0cm 0cm 10pt\">&nbsp;<span style=\"font-size: 10pt\"><strong>Wymiary po rozsuniciu:<br />
            </strong></span><span style=\"font-size: 10pt\"><br />
            - dugo&nbsp;&nbsp;&nbsp; &nbsp;250cm lub 290cm<br />
            - szeroko 100cm<br />
            - wysoko&nbsp;&nbsp; 75cm<br />
            <br />
            <br />
            <br />
            </span></div>
            </td>
        </tr>
    </tbody>
</table>
Opis krzesa Wellington:<br />
<div style=\"margin: 0cm 0cm 10pt\">
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</font></span></p>
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\">Krzeso skadane WELLINGTON dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</font></span></p>
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\">Wymiary kartonu w mm: 935x595x155</font></span></p>
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\">Moliwo dokupienia:</font></span></p>
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\">- poduch do siedzenia</font></span></p>
<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"><font size=\"3\" face=\"Calibri\"><br />
Koszty wysyki zestawu (st Stockholm z&nbsp;8 krzesami Wellington)<br />
- kurierem po wpacie na konto 240z<br />
- przesyka kurierem za pobraniem&nbsp; 250z<br />
<br />
</font></span></p>
</div>
<div style=\"margin: 0cm 0cm 10pt\"><b><span style=\"font-size: 10pt\">Dlaczego eukaliptus?</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne.<br />
</span>
<p class=\"MsoNormal\"><span style=\"font-size: 10pt\"><b><span style=\"font-size: 13.5pt\">Klasy twardoci drewna wedug Brinella</span></b></span></p>
<table cellspacing=\"3\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\">
    <tbody>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\"><b>Klasa</b></p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\"><b>Wspczynnik Brinella</b></p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\"><b>Przykadowe gatunki</b></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">I</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH &lt; 2,0</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">sosna</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">II</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH 2,1 - 3</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">olcha, brzoza, klon europejski</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">III</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH 3,1 - 4</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">czerenia, maho, orzech amerykaski, sapella, iroko, teak, winia, db, db czerowny, buk, jesion</p>
            </td>
        </tr>
        <tr>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">IV</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">BNH &gt; 4,1</p>
            </td>
            <td style=\"padding-bottom: 0.75pt; padding-left: 0.75pt; padding-right: 0.75pt; padding-top: 0.75pt\">
            <p class=\"MsoNormal\">drzewo rane, doussie, palisander, <strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</p>
            </td>
        </tr>
    </tbody>
</table>
<p align=\"center\" class=\"MsoNormal\" style=\"text-align: center\"><b>I &ndash; drewno mikkie</b></p>
<p align=\"center\" class=\"MsoNormal\" style=\"text-align: center\"><b>II &ndash; drewno redniej twardoci</b></p>
<p align=\"center\" class=\"MsoNormal\" style=\"text-align: center\"><b>III &ndash; drewno twarde</b></p>
<p align=\"center\" class=\"MsoNormal\" style=\"text-align: center\"><b>IV &ndash; bardzo twarde drewno<br />
<br />
</b></p>
</div>
<div align=\"center\" style=\"text-align: center; margin: 0cm 0cm 10pt\"><b><span style=\"font-size: 10pt\">Nasze meble wykonane s z drewna certyfikowanego FSC</span></b><span style=\"font-size: 10pt\">.</span></div>
<div align=\"center\" style=\"text-align: center; margin: 0cm 0cm 10pt\">&nbsp;</div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Meble s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></div>
</div>
