<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Arial Unicode MS\'\">Drewniany komplet mebli ogrodowych <b>Cayenne</b> wykonany jest z drewna eukaliptusowego. Cechami tego materiau jest trwao i odporno na zmienne warunki pogodowe. Zestaw <b>Cayenne</b>  idealnie nadaje si na mae tarasy lub balkony. Wszystkie meble s  bardzo funkcjonalne poniewa mona je zoy w prosty sposb, co uatwia  ich przechowywanie lub transport.<br />
W skad zestawu wchodzi&nbsp; st <b>Cayenne</b> w ksztacie kwadratu&nbsp; oraz 4 krzesa skadane Cayenne.<br />
Meble doskonale sprawdz si rwnie w Twoim ogrodzie. <br />
Komplet ogrodowy &quot; jest bardzo atwy w pielgnacji. Zarwno st jak i  krzesa s w stanie zmontowanym wystarczy je rozpakowa z kartonw.  Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na  gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali  twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do  klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s  z drewna z certyfikatem FSC.&nbsp; <br />
<br />
Koszt wysyki zestawu st + 4 krzesa:<br />
*50z po wpacie na konto<br />
*60z wysyka za pobraniem<br />
<br />
<b>Opis krzesa Cayenne:<br />
</b><br />
Cayenne  krzeso skadane. Wysokiej jakoci krzeso. Wykonane z cennego   rodzaju&nbsp;drewna eukaliptusa. Drewno to dziki swej naturalnej oleistoci   jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W   czterostopniowej skali twardoci drewna wg Brinella drewno  eukaliptusowe  zaliczane jest do klasy IV obejmujcej bardzo twarde  drewno. Oferowane  krzesa wykonane s z drewna z certyfikatem FSC.</span></p>
<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Arial Unicode MS\'\">Krzeso   skadane CAYENNE dziki perfekcyjnie gadkim powierzchniom zapewnia   wysoki komfort uytkowania. Krzeso dostarczane w stanie zmontowanym,   zapakowane w bezpieczny karton. </span></p>
<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Arial Unicode MS\'\">Dopracowane w kadym szczegle. Bardzo komfortowe. Krzeso skadane.</span></p>
<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Arial Unicode MS\'\">Wymiary kartonu w mm: 1080x395x215<br />
</span></p>
<span style=\"line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; font-size: 12pt; mso-fareast-language: PL; mso-fareast-font-family: \'Arial Unicode MS\'\">W kartonie znajduj si 2 krzesa <br />
<br />
<b>Opis stolu Cayenne:</b></span><br />
<br />
St Cayenne wykonany jest z drewna eukaliptusowego. W sam raz na  balkon, taras czy do ogrodu. Dopracowany w kadym szczegle. Blat stou  ma ksztat kwadratu. Po dokupieniu krzese Cayenne maj Pastwo  moliwo stworzenia niezwykle eleganckiego zestawu, obok ktrego nikt  nie przejdzie obojtnie.St jest bardzo atwy w montau.<br />
<br />
<br />
<br />
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\"> </span><b><span style=\"font-size: 10pt\">Wymiary:</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">- szeroko 70cm</span><br />
<span style=\"font-size: 10pt\">- dugo&nbsp;&nbsp;&nbsp;&nbsp;70cm</span><br />
<span style=\"font-size: 10pt\">- wysoko 72cm<br />
<br />
</span></div>
<div style=\"margin: 0cm 0cm 10pt\">&nbsp;<b><span style=\"font-size: 10pt\">Dlaczego eukaliptus?</span></b></div>
<div style=\"margin: 0cm 0cm 10pt\"><span style=\"font-size: 10pt\">Drewno   jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada   kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci   drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s   materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. <br />
</span>
