<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Zestaw 6-7 osobowy: St Dover, 3-osobowa awka Edinburgh z poduch i <span style=\"mso-spacerun:yes\">&nbsp;</span>4 Fotele Edinburgh z poduchami<br />
PROMOCJA!!!<br />
KUPUJC ZESTAW OSZCZDZASZ 264 z!!! <br />
WARTO POSZCZEGLNYCH ELEMENTW ZESTAWU TO 2819 z, CENA PROMOCYJNA ZESTAWU 2555 z!!!<br type=\"_moz\" />
</span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Elegancki zestaw wykonany jest z drewna eukaliptusowego, ktre charakteryzuje si du oleistoci. Eukaliptus jest odporny na warunki atmosferyczne. </span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">W skad zestawu wchodz:</span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- st Dover</span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- 4 komfortowe fotele Edinburgh</span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- 4 dwustronne, wygodne dedykowane poduchy do foteli</span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- 3-osobow awk Edinburgh </span></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- dwustronn, wygodn dedykowan poduszk do awki</span></p>
<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
color:#2B2B2B;mso-fareast-language:PL\"><span style=\"mso-spacerun:yes\">&nbsp;</span>Fotel Edinburgh:</span></b></p>
<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
PL\">Wysokiej jakoci fotel. Wykonany z cennego rodzaju&nbsp;drewna eukaliptusa.</span></p>
<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
PL\">Dopracowany w kadym szczegle. Bardzo komfortowy. </span></p>
<table width=\"107%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\" style=\"width:107.78%;mso-cellspacing:0cm;mso-yfti-tbllook:1184;mso-padding-alt:
    1.5pt 1.5pt 1.5pt 1.5pt\">
    <tbody>
        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes\">
            <td width=\"100%\" style=\"width:100.0%;padding:1.5pt 1.5pt 1.5pt 1.5pt\">
            <p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-bidi-font-family:Tahoma;color:#2B2B2B\">Zestaw dostarczany w elementach, wraz   z zestawem montaowym (wkrty oraz imbus). Czytelna instrukcja uatwi Pastwu   szybki monta.</span></p>
            <p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">&nbsp;</span><span style=\"font-family:
            &quot;Verdana&quot;,&quot;sans-serif&quot;\">Zachcamy do zakupienia eleganckich parasoli   ogrodowych oraz praktycznego mini barku Sherwood. </span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
            PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">Kady produkt jest oryginalnie   zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b><span style=\"font-family:
            &quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:
            &quot;Times New Roman&quot;;mso-fareast-language:PL\">Fotel jest zapakowany w bezpieczny   karton. W kartonie znajduje si jeden fotel.</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b><span style=\"font-family:
            &quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:
            &quot;Times New Roman&quot;;mso-fareast-language:PL\">awka Edinburgh.</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-bidi-font-family:Tahoma;color:#2B2B2B\">Jedyny w swoim rodzaju ksztat   awki Edinburgh oraz niezwykle trwae drewno eukaliptusowe sprawiaj, e   awka Edinburhg jest niezwykle pikna i elegancka oraz moe posuy przez   wiele lat.<br />
            Warto doda, e te awki s bardzo starannie wykonane i wykoczone oraz   odporne na gnicie. Zostay stworzone po to, aby mogli Pastwo cieszy si   widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Szczegowy   opis produktu <b style=\"mso-bidi-font-weight:normal\">St Dover</b></span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
            PL\">Wysokiej jakoci st. Wykonany z cennego rodzaju&nbsp;drewna   eukaliptusa. Dopracowany w kadym szczegle. Blat stou ma ksztat   prostokta. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\"><br />
            <b>Wymiary:</b></span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">- dugo&nbsp;&nbsp;&nbsp; 150cm<br />
            - szeroko&nbsp; 80cm<br />
            -&nbsp; wysoko&nbsp;&nbsp;&nbsp; 75cm</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;
            mso-fareast-language:PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b style=\"mso-bidi-font-weight:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">Proponowany przez nas zestaw moecie Pastwo modyfikowa i tworzy rne   kombinacje z fotelami i awkami. Chtnie skalkulujemy Pastwa &nbsp;wymarzony   zestaw.</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b style=\"mso-bidi-font-weight:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">&nbsp;</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Koszty   wysyki zestawu :<br />
            - kurierem po wpacie na konto &ndash; 120 z<br />
            - przesyka kurierem za pobraniem 130z</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b style=\"mso-bidi-font-weight:
