            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno   posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci   drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s   materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. </span></p>
