<p align=\"center\" style=\"text-align:center\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
color:#00B050\">Zestaw ogrodowy st Toledo <span style=\"mso-spacerun:yes\">&nbsp;</span>i <span style=\"mso-spacerun:yes\">&nbsp;</span>6 krzese Baltic + 6 poduch<br />
<br />
</span></b><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">PROMOCJA!!!<br />
KUPUJC ZESTAW OSZCZDZASZ 337 z!!! <br />
WARTO POSZCZEGLNYCH ELEMENTW ZESTAWU TO 3007 z, CENA PROMOCYJNA ZESTAWU 2670 z!!!</span></b></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;\">Elegancki zestaw wykonany jest z drewna eukaliptusowego, ktre charakteryzuje si du oleistoci. Eukaliptus jest odporny na warunki atmosferyczne. </span></p>
<p align=\"center\" style=\"text-align:center\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:
normal\"><u><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
color:#00B050\">Wszystkie produkty z drewna eukaliptusowego oferowane na naszych aukcjach posiadaj certyfikat FSC.</span></u></b></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;</span></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">W skad zestawu wchodz:</span></u></b></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;\">- st <span style=\"mso-spacerun:yes\">&nbsp;</span>Toledo</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 komfortowych krzese <span style=\"mso-spacerun:yes\">&nbsp;</span>Baltic z 5-cio stopniow regulacj oparcia</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 wygodnych poduch &ndash; Pastwo wybieraj kolor</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Ekskluzywny zestaw dopracowany w kadym szczegle. Bardzo komfortowy. <br />
Jedyny w swoim rodzaju ksztat krzese oraz niezwykle trwae drewno eukaliptusowe sprawiaj, e zestaw jest bardzo oryginalny i elegancki oraz moe posuy przez wiele lat.<br />
Stworzony po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach.<br style=\"mso-special-character:line-break\" />
<br style=\"mso-special-character:line-break\" />
</span></p>
<p style=\"line-height:normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;
font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
mso-fareast-language:PL\">Meble z drewna eukaliptusowego oferowane na naszych aukcjach s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">St&nbsp;dostarczamy w elementach, wraz z zestawem montaowym (wkrty oraz imbus).</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Czytelna instrukcja uatwi Pastwu szybki monta. Krzesa gotowe do uycia po wyjciu z opakowania.</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;</span></p>
<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
normal\" class=\"MsoNormal\"><b><u><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Koszty wysyki zestawu:</span></u></b><b><span style=\"font-size:12.0pt;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
PL\"><br />
</span></b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">*170 z po wpacie na konto,<br />
*180 z przy wysyce za pobraniem</span></p>
<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
line-height:normal\" class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Zachcamy do zakupienia eleganckich parasoli ogrodowych oraz praktycznego mini barku Sherwood (na naszych innych aukcjach).</span></b></p>
<p style=\"mso-margin-top-alt:auto;margin-bottom:0cm;margin-bottom:
.0001pt;line-height:normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:
&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
PL\"><br />
Szczegowy opis produktw wchodzcych w skad zestawu znajduje si poniej.</span></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><u><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
color:#00B050\">Krzeso Baltic</span></u></b><span style=\"font-size:12.0pt;
line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#00B050\"> </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&ndash; komfortowe krzeso z 5 stopniow regulacj oparcia</span></p>
<p style=\"line-height:normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;
font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
mso-fareast-language:PL\">Krzeso wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></p>
<p style=\"line-height:normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;
font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
mso-fareast-language:PL\">Krzeso skadane Baltic dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</span></p>
