<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Zestaw 6- osobowy St Stockholm 160-220cm i 6 Krzese Cardiff<br />
<br />
</span></b><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">PROMOCJA!!!<br />
KUPUJC ZESTAW OSZCZDZASZ 283 z!!! <br />
WARTO POSZCZEGLNYCH ELEMENTW ZESTAWU TO 2353 z, CENA PROMOCYJNA ZESTAWU 2070 z!!!</span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Elegancki zestaw wykonany jest z drewna eukaliptusowego, ktre charakteryzuje si du oleistoci. Eukaliptus jest odporny na warunki atmosferyczne. </span></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">W skad zestawu wchodz:</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- rozkadany st Stockholm 160-220cm</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">- 6 komfortowych krzese Cardiff (moliwo dokupienia poduch) </span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:
Tahoma;color:#2B2B2B\">Zestaw dopracowany w kadym szczegle. Bardzo komfortowy. <br />
Jedyny w swoim rodzaju ksztat krzese oraz niezwykle trwae drewno eukaliptusowe sprawiaj, e zestaw jest bardzo oryginalny i elegancki oraz moe posuy przez wiele lat.<br />
Stworzony po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach.<br />
Zestaw dostarczany w elementach, wraz z zestawem montaowym (wkrty oraz imbus). Czytelna instrukcja uatwi Pastwu szybki monta. </span></p>
<table width=\"103%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\" style=\"width:103.1%;mso-cellspacing:0cm;mso-yfti-tbllook:1184;mso-padding-alt:
    1.5pt 1.5pt 1.5pt 1.5pt\">
    <tbody>
        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes\">
            <td width=\"100%\" style=\"width:100.0%;padding:1.5pt 1.5pt 1.5pt 1.5pt\">
            <p class=\"MsoNormal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">&nbsp;</span><span style=\"font-family:
            &quot;Verdana&quot;,&quot;sans-serif&quot;\">Zachcamy do zakupienia eleganckich parasoli   ogrodowych oraz praktycznego mini barku Sherwood.</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:
            PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">Kady produkt jest oryginalnie   zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Koszty   wysyki zestawu :<br />
            - kurierem po wpacie na konto &ndash; 130 z<br />
            - przesyka kurierem za pobraniem 140 z</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Szczegowy   opis produktu <b style=\"mso-bidi-font-weight:normal\">krzesa Cardiff </b>;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;color:#2B2B2B\">Krzeso wykonane z wysokiej   jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci   jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-bidi-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Krzeso skadane Cardiff dziki perfekcyjnie gadkim powierzchniom   zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie   pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji.   Krzeso dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-bidi-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Wymiary kartonu w mm: 935x595x155<br />
            W kartonie znajduje si 1 krzeso. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Szczegowy   opis produktu <b style=\"mso-bidi-font-weight:normal\">St Stockholm:</b></span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;
            mso-fareast-language:PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-size:12.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Tahoma;
            color:#2B2B2B;mso-fareast-language:PL\">Stockholm st.&nbsp;Wysokiej jakoci   st. Wykonany z cennego rodzaju&nbsp;drewna eukaliptusa. Dopracowany w   kadym szczegle. Blat stou ma ksztat owalu. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:PL\"><br />
            <b>Wymiary Standardowe:<br />
            </b><br />
            - dugo&nbsp;&nbsp; 160cm<br />
            - szeroko 90cm<br />
            - wysoko&nbsp; 75cm</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-size:12.0pt;
            font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-bidi-font-family:Tahoma;color:#2B2B2B;mso-fareast-language:PL\">&nbsp;&nbsp;<b>Wymiary   po rozsuniciu:<br />
            </b><br />
            - dugo&nbsp;&nbsp; 220cm<br />
            - szeroko 90cm<br />
            - wysoko&nbsp; 75cm</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b style=\"mso-bidi-font-weight:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">&nbsp;</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b style=\"mso-bidi-font-weight:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">Moliwo dokupienia komfortowych poduch na innych naszych aukcjach.</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;
            mso-fareast-language:PL\">&nbsp;<b>Dlaczego eukaliptus?</b></span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:
            PL\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno   posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci   drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s   materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. </span></p>
            <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
