insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('87', '1', 'Krzeso 5-pozycyjne (Baltic lub Cardiff lub Wellington) + poducha do wyboru', '<!-- TW_OPIS_START -->
<h2><font face=\"Verdana\">Krzeso 5-pozycyjne + poducha</font></h2>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Proponujemy Pastwu wysokiej jakoci krzesa z 5-stopniow regulacj oparcia. Wybr modelu naley do klienta. W podanej cenie oferujemy krzesa z linii Baltic, Wellington lub Cardiff.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Dodatkowo w cenie poduszka do krzesa - wybr rodzaju/koloru rwnie pozostawiamy w Pastwa gestii.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Poduchy w kolorze czerwonym, pomaraczowym oraz brzowym posiadaja zamki byskawiczne, dziki czemu w razie zabrudzenia mona zdj poszewk do wyprania.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Poduszki w kolorze zielonym oraz ceglasto-czerwonym s bardzo komfortowe - wypenione s 5cm piank, poszewka zszyta podwjnym szwem, nie ma moliwoci zdjcia poszewki.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Krzesa wykonane z wysokiej jakoci drewna eukaliptusowego. Drewno to dziki swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Nasze krzesa skadane dziki perfekcyjnie gadkim powierzchniom zapewnia wysoki komfort uytkowania. Regulowane w piciu zakresach oparcie pozwala na dostosowanie ustawie krzesa do indywidualnych preferencji. Krzesa dostarczane w stanie zmontowanym, zapakowane w bezpieczny karton.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Wymiary kartonu w mm:</span></b><span style=\"font-family: Verdana;\"> 935x595x155</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Waga z kartonem:</span></b><span style=\"font-family: Verdana;\"> 10,2 - 10,5 kg</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">W kartonie znajduje si 1 krzeso.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Koszty wysyki :</span></b></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- kurierem po wpacie na konto</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 1 krzeso &nbsp;z poduch 30z</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* 2 krzesa + 2 poduchy 50z</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* kade kolejne 2szt. 50zl</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">- przesyka kurierem za pobraniem dodatkowo 10z</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">W ofercie mamy rwnie stoy ogrodowe z drewna eukaliptusowego.</span></div>
<div class=\"opis_z_subiekta\" style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<h3><span style=\"font-family: Verdana;\">Dlaczego eukaliptus?</span></h3>
<h3>
<p class=\"MsoNormal\" style=\"font-size: 12px; font-weight: normal; text-align: justify;\"><span style=\"font-family: Verdana;\">Drewno jest bardzo cenne, wybitnie odporne na gnicie. Naturalne drewno posiada kolor od tego do czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i niszczce warunki atmosferyczne. &nbsp;</span></p>
</h3>
<h4><span style=\"font-size: 13.5pt;\">Klasy twardoci drewna wedug Brinella</span></h4>
<h3>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt;\">
<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">
    <tbody>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\"><b>Klasa</b></span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\"><b>Wspczynnik Brinella</b></span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\"><b>Przykadowe gatunki</b></span></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">I</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">BNH &lt; 2,0</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">sosna</span></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">II</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">BNH 2,1 - 3</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">olcha, brzoza, klon europejski</span></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">III</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">BNH 3,1 - 4</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">czerenia, maho, orzech amerykaski, sapella, iroko, teak, winia, db, db czerowny, buk, jesion</span></p>
            </td>
        </tr>
        <tr>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">IV</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">BNH &gt; 4,1</span></p>
            </td>
            <td style=\"padding: 0.75pt;\">
            <p class=\"MsoNormal\"><span style=\"font-family: Verdana;\">drzewo rane, doussie, palisander,&nbsp;<strong><u>EUKALIPTUS</u></strong>, klon kanadyjski, merbau, badi, tali, jatoba</span></p>
            </td>
        </tr>
    </tbody>
</table>
<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><span style=\"font-family: Verdana;\"><b>I &ndash; drewno mikkie</b></span></p>
<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><span style=\"font-family: Verdana;\"><b>II &ndash; drewno redniej twardoci</b></span></p>
<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><span style=\"font-family: Verdana;\"><b>III &ndash; drewno twarde</b></span></p>
<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><span style=\"font-family: Verdana;\"><b>IV &ndash; bardzo twarde drewno</b></span></p>
</div>
<div align=\"center\" style=\"font-size: 12px; font-weight: normal; text-align: center; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\"><b><span style=\"font-size: 10pt;\">Nasze meble wykonane s z drewna certyfikowanego FSC</span></b><span style=\"font-size: 10pt;\">.</span></span></div>
<div align=\"center\" style=\"font-size: 12px; font-weight: normal; text-align: center; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu gwarantujemy bezpieczn wysyk.</span></span></div>
<div style=\"font-size: 12px; font-weight: normal; margin: 0cm 0cm 10pt;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Meble s poddane konserwacji specjalnym olejem, ktry sprawia, e drewno staje si hydrofobowe &ndash; odporne na wod i inne pyny, nie ulega zaplamieniu, jest te odporne na biodegradacj (dziaanie grzybw). Olej piknie oywia drewno i podkrela rysunek jego sojw.</span></span></div>
</h3>
<div class=\"charakterystyka_z_subiekta\">
<p style=\"margin: 0cm 0cm 10pt; text-align: justify;\" class=\"MsoNormal\"><font size=\"3\" face=\"Calibri\"> </font></p>
</div>', '', '', '97', 'Krzeso 5-pozycyjne (Baltic lub Cardiff lub Wellington) + poducha do wyboru', 'Wysokiej klasy krzeso 5-pozycyjne wraz z poduszk z rattanu, technorattanu oraz eukaliptusa. Zapraszamy!', 'Krzesa ogrodowe, krzesa drewniane, krzesa do ogrodu, krzesa z rattanu, krzesa technorattan, krzesa eukaliptus', '');
