insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('88', '1', 'Zestaw wypoczynkowy RASF-057', '<div style=\"text-align: center;\"><span style=\"color: rgb(128, 128, 0);\"><span style=\"font-size: larger;\"><u><b>Zestaw wypoczynkowy RASF - 057</b></u></span></span><span style=\"color: rgb(153, 204, 0);\"><span style=\"font-size: larger;\"><u><b><br />
<br />
</b></u></span></span></div>
<div style=\"text-align: center;\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">PROMOCJA!!!<br />
KUPUJC ZESTAW OSZCZDZASZ 500 z!!! <br />
CENA REGULARNA ZESTAWU TO 2700 z, CENA PROMOCYJNA 2200 z!!!</span></b></div>
Geometrycznie wyrazisty i niezwykle efektowny zestaw wypoczynkowy jaki Pastwu prezentujemy to idealny komplet dla klientw o wybitnie wyrafinowanym smaku stylowym. Doskonale nadajcy si zarwno do ogrodu czy tarasu, ale take do uytku wewntrz pomieszcze. Zestaw skada si z dwch bardzo wygodnych foteli , sofy 3 osobowej oraz funkcjonalnego stou. Blat stou wykonany jest z cennego drewna akacji. Mikkie poduszki 5 cm gruboci posiadaj poszewk z wszytym zamkiem byskawicznym dziki czemu w razie zabrudzenia mona j zdj&nbsp; do wyprania.<br />
<br />
<u><b>Wymiary:</b></u><br />
<br />
St :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 110 x 55 x 40<br />
<br />
Fotel (2szt): &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; 60 x 58 x 90<br />
<br />
Sofa 3 osobowa.: &nbsp; &nbsp;&nbsp; 190 x 75 x 70<br />
<br />
&nbsp;<br />
<br />
<span style=\"font-size: larger;\"><u><b>Koszt wysyki caego zestawu:</b></u></span><br />
<br />
*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 140 z po wpacie na konto<br />
*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 150&nbsp; z wysyka za pobraniem<br />
<br />
<span style=\"font-size: larger;\"><u><b>&nbsp;Dlaczego technorattan?</b></u></span><br />
<br />
Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.<br />
<br />
Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.<br />
<br />
Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.<br />
<br />
Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.<br />
<br />
<span style=\"font-size: larger;\"><u><b>Dlaczego akacja?</b></u></span><br />
<br />
&nbsp;<br />
&nbsp; Meble wykonane z drewna akacjowego s bardzo trwae. To twarde drewno z szybko rosncych drzew najczciej pochodzi z Dalekiego Wschodu lub Poudniowej Ameryki. Zrnicowane odcienie koloru sprawiaj, i meble z niego wykonane nabieraj ciepego wygldu. Drewno to zostao okrelone jako odpowiednie do wytwarzania mebli, nieruchomych osi pojazdw, zbw k zbatych lub klinw. Z powodu swojej twardoci, siy, braku sprystoci wykorzystywane byo przy produkcji statkw<br type=\"_moz\" />', '', '', '134', 'Zestaw wypoczynkowy RASF-057 - Meble ogrodowe technorattan', 'Doskonae meble obiadowe z technorattanu. Wysoka jako w rewelacyjnej cenie. Zapraszamy na Rattanland.pl!', 'meble ogrodowe, stoy ogrodowe, krzesa ogrodowe, meble do ogrodu, meble ogrodowe z rattanu, meble tecnnorattan, meble eukaliptus, meble z rattanu sklep internetowy, rattan', '');
