<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Zestaw 6-osobowy St Lancaster, 6 krzese Tenerife + poduchy </span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Elegancki zestaw wykonany jest z drewna eukaliptusowego, ktre charakteryzuje si du oleistoci. Eukaliptus jest odporny na warunki atmosferyczne. </span></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">W skad zestawu wchodz:</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- st Lancaster</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 krzese Tenerife </span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 dwustronne poduchy na krzesa</span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
color:#2B2B2B\">Zestaw dopracowany w kadym szczegle. <br />
Jedyny w swoim rodzaju ksztat krzese oraz niezwykle trwae drewno eukaliptusowe sprawiaj, e zestaw jest bardzo oryginalny i elegancki oraz moe posuy przez wiele lat.<br />
Stworzony po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach.<br />
Zestaw dostarczany w elementach, wraz z zestawem montaowym (wkrty oraz imbus). Czytelna instrukcja uatwi Pastwu szybki monta. </span></p>
<table width=\"99%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\" style=\"width:99.68%;mso-cellspacing:0cm;margin-left:1.5pt;mso-yfti-tbllook:
    1184;mso-padding-alt:1.5pt 1.5pt 1.5pt 1.5pt\">
    <tbody>
        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes\">
            <td width=\"100%\" style=\"width:100.0%;padding:1.5pt 1.5pt 1.5pt 1.5pt\">
            <p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">&nbsp;</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Zachcamy   do zakupienia eleganckich parasoli ogrodowych oraz praktycznego mini barku   Sherwood.</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:PL\">&nbsp;</span></p>
