            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu   gwarantujemy bezpieczn wysyk.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Koszty   wysyki zestawu :<br />
            - kurierem po wpacie na konto &ndash; 80 z<br />
            - przesyka kurierem za pobraniem<span style=\"mso-spacerun:yes\">&nbsp; </span>90z</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Szczegowy   opis produktu <b style=\"mso-bidi-font-weight:normal\">St Lancaster</b>;</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:PL\">Wysokiej jakoci   st. Wykonany z cennego rodzaju drewna eukaliptusa. Dopracowany w kadym   szczegle. Blat stou ma ksztat prostokta. </span></p>
