            mso-fareast-font-family:&quot;Arial Unicode MS&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Tenerife krzeso skadane. Wysokiej jakoci krzeso. Wykonane z cennego   rodzaju&nbsp;drewna eukaliptusa. Drewno to dziki swej naturalnej oleistoci   jest wybitnie odporne na gnicie i niekorzystne warunki atmosferyczne. W   czterostopniowej skali twardoci drewna wg Brinella drewno eukaliptusowe   zaliczane jest do klasy IV obejmujcej bardzo twarde drewno. Oferowane   krzesa wykonane s z drewna z certyfikatem FSC.</span></p>
            <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
            text-align:justify;line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Arial Unicode MS&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Krzeso skadane TENERIFE dziki perfekcyjnie gadkim powierzchniom   zapewnia wysoki komfort uytkowania. Krzeso dostarczane w stanie   zmontowanym, zapakowane w bezpieczny karton. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Arial Unicode MS&quot;;color:#2B2B2B\">W kartonie znajduj   si 2 krzesa.</span></p>
