<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center\"><b style=\"mso-bidi-font-weight:
normal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\">Zestaw 6-osobowy St Dover, 6 krzese Carolina + poduchy </span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Elegancki zestaw wykonany jest z drewna eukaliptusowego, ktre charakteryzuje si du oleistoci. Eukaliptus jest odporny na warunki atmosferyczne. </span></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">W skad zestawu wchodz:</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- st Dover</span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 skadanych krzese Carolina </span></b></p>
<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">- 6 dwustronnych poduch na krzesa</span></b></p>
<p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
color:#2B2B2B\">Zestaw dopracowany w kadym szczegle. <br />
Jedyny w swoim rodzaju ksztat krzese oraz niezwykle trwae drewno eukaliptusowe sprawiaj, e zestaw jest bardzo oryginalny i elegancki oraz moe posuy przez wiele lat.<br />
Stworzony po to, aby mogli Pastwo cieszy si widokiem swojego ogrodu i wypoczywa w&nbsp;komfortowych warunkach.<br />
Zestaw dostarczany w elementach, wraz z zestawem montaowym (wkrty oraz imbus). Czytelna instrukcja uatwi Pastwu szybki monta. </span></p>
<table width=\"99%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\" style=\"width:99.68%;mso-cellspacing:0cm;margin-left:1.5pt;mso-yfti-tbllook:
    1184;mso-padding-alt:1.5pt 1.5pt 1.5pt 1.5pt\">
    <tbody>
        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes\">
            <td width=\"100%\" style=\"width:100.0%;padding:1.5pt 1.5pt 1.5pt 1.5pt\">
            <p class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">&nbsp;</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Zachcamy   do zakupienia eleganckich parasoli ogrodowych oraz praktycznego mini barku   Sherwood.</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Kady produkt jest oryginalnie zapakowany przez producenta dziki czemu   gwarantujemy bezpieczn wysyk.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Koszty   wysyki zestawu :<br />
            - kurierem po wpacie na konto &ndash; 80 z<br />
            - przesyka kurierem za pobraniem<span style=\"mso-spacerun:yes\">&nbsp; </span>90z</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Szczegowy   opis produktu <span style=\"mso-spacerun:yes\">&nbsp;</span><b style=\"mso-bidi-font-weight:
            normal\">St Dover</b>;</span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:PL\">Wysokiej jakoci   st. Wykonany z cennego rodzaju drewna eukaliptusa. Dopracowany w kadym   szczegle. Blat stou ma ksztat prostokta. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\"><br />
            <b>Wymiary:</b></span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">- dugo&nbsp;&nbsp; 150cm<br />
            - szeroko 80cm<br />
            - wysoko &nbsp;75cm</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\"><br />
            <b>St jest zapakowany w karton. W kartonie znajduje si jeden st.</b></span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><b><span style=\"font-family:
            &quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;
            mso-fareast-language:PL\">&nbsp;</span></b></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Szczegowy   opis produktu <b style=\"mso-bidi-font-weight:normal\">krzese skadanych Carolina</b>;</span></p>
            <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
            text-align:justify;line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Carolina</span><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Arial Unicode MS&quot;;
            color:#2B2B2B;mso-fareast-language:PL\"> krzeso skadane. Wysokiej jakoci   krzeso. Wykonane z cennego rodzaju&nbsp;drewna eukaliptusa. Drewno to dziki   swej naturalnej oleistoci jest wybitnie odporne na gnicie i niekorzystne   warunki atmosferyczne. W czterostopniowej skali twardoci drewna wg Brinella   drewno eukaliptusowe zaliczane jest do klasy IV obejmujcej bardzo twarde   drewno. Oferowane krzesa wykonane s z drewna z certyfikatem FSC.</span></p>
            <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
            text-align:justify;line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Arial Unicode MS&quot;;color:#2B2B2B;mso-fareast-language:
            PL\">Krzeso skadane CAROLINA dziki perfekcyjnie gadkim powierzchniom   zapewnia wysoki komfort uytkowania. Krzeso dostarczane w stanie   zmontowanym, zapakowane w bezpieczny karton. </span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Arial Unicode MS&quot;;color:#2B2B2B\">W kartonie znajduj   si 2 krzesa.</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;</span></p>
            <p class=\"MsoNormal\" style=\"line-height:normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">&nbsp;<b>Dlaczego   eukaliptus?</b></span></p>
            <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:
            normal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:
            &quot;Times New Roman&quot;;mso-fareast-language:PL\">Drewno jest bardzo cenne, wybitnie   odporne na gnicie. Naturalne drewno posiada kolor od tego do   czerwono-brzowego. Dziki naturalnej odpornoci drewno to zalecane jest do   zastosowania na zewntrz, gdzie wymagane s materiay wytrzymae na zmienne i   niszczce warunki atmosferyczne. </span></p>
            <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;
            line-height:normal\"><b><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
            mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Klasy   twardoci drewna wedug Brinella</span></b></p>
