                        auto;line-height:normal\" class=\"MsoNormal\"><b><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
                        mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">Wspczynnik     Brinella</span></b></p>
                        </td>
                        <td style=\"padding:.75pt .75pt .75pt .75pt\">
                        <p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:
