                        </td>
                        <td style=\"padding:.75pt .75pt .75pt .75pt\">
                        <p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:
                        auto;line-height:normal\" class=\"MsoNormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;
                        mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:PL\">BNH 2,1     - 3</span></p>
