</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Nowoczesne  wzornictwo, prostota a zarazem elegancja to wszystko znajd Pastwo w  zestawie wypoczynkowy RASF-055, ktry zapewni Pastwu wspaniae chwile w  domu czy ogrodzie. Dostpne tylko w kolorze czarnym.W skad kompletu  wchodz dwie 1-osobowe sofy oraz funkcjonalny  stolik z &nbsp;8mm hartowanym szkem. Poduchy do tego zestawu w kolorze  kremowym 5cm gruboci posiadaj poszewki z wszytym zamkiem byskawicznym  ktre w razie zabrudzenia mona zdj i wypra.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Wymiary:</span></b></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Stolik ze szkem: 80 x 80 x 40</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Sofa 1os.:104 x 100 x 75</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br type=\"_moz\" />
</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Koszt wysyki caego zestawu:</span></b></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* &nbsp; &nbsp; &nbsp;&nbsp; 150 z po wpacie na konto</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* &nbsp; &nbsp; &nbsp;&nbsp; 160 z wysyka za pobraniem</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<h3><span style=\"font-family: Verdana;\">Dlaczego technorattan?</span></h3>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Wykonany  z wysokiej jakoci tworzywa syntetycznego jakim jest wkno  polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i  odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny  rattan.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Jego  gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu  meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania  promieni sonecznych. Dziki swym waciwociom wykazuje si take  odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl,  chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Technorattan  do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu,  poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Warto  rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s  wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na  rozciganie. W skadzie chemicznym technorattanu nie wystpuj  substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj  si recyklingowi.</span></div>', '', '', '87', 'Zestaw wypoczynkowy RASF-055 (2)', 'Zestaw wypoczynkowy RASF-055 (2)', 'Zestaw wypoczynkowy RASF-055 (2)', '');
