insert into products_description (products_id, language_id, products_name, products_description, products_short_description, products_url, products_viewed, products_head_title_tag, products_head_desc_tag, products_head_keywords_tag, products_seo_url) values ('99', '1', 'Leanka Sun ze stolikiem', '<h2><span style=\"font-family: Verdana;\">Leanka SUN</span></h2>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Dla wszystkich tych, ktrzy poszukuj przyjemnego wypoczynku w orientalnej stylizacji z lekka nutk luksusu proponujemy pikne rkodzieo jakim jest leanka. Ten komfortowy i bardzo wygodny mebel wyposaony jest w komplet mikkich poduszek oraz materac. Pokrowce na poduszki i na materac posiadaj wszyte zamki byskawiczne dziki czemu w razie zabrudzenia mona zdj poszewk do wyprania. Pozornie duy rozmiar leanki moe sugerowa na jej znaczn wag. Jest to tylko zudzenie optyczne, poniewa odpowiednio dobrany splot wkiem technorattanu zapewnia jej lekko, co pozwala na jej swobodne przesuwanie i przenoszenie. Razem z leank oferujemy stylowy stolik ze szklanym blatem.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<div style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Wymiary leanki:</span></b><span style=\"font-family: Verdana;\"> &nbsp;181 x 176 x 70h</span></div>
<div style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Wymiary stolika:</span></b><span style=\"font-family: Verdana;\"> 86 x 60 x 39h</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>
<div style=\"text-align: justify;\"><b><span style=\"font-family: Verdana;\">Koszt wysyki caego zestawu:</span></b></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* &nbsp; &nbsp; &nbsp; &nbsp;170 z po wpacie na konto</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">* &nbsp; &nbsp; &nbsp; &nbsp;180 z wysyka za pobraniem</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\"><br />
</span></div>
<h3><span style=\"font-family: Verdana;\">Dlaczego technorattan?</span></h3>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Wykonany z wysokiej jakoci tworzywa syntetycznego jakim jest wkno polietylenowe o duej wytrzymaoci zarwno mechanicznej, jak i odpornoci na warunki atmosferyczne, zdecydowanie przewysza naturalny rattan.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Jego gwnym atutem jest odporno na dziaanie promieni UV, dziki czemu meble wykonane z technorattanu nie odbarwiaj si pod wpywem dziaania promieni sonecznych. Dziki swym waciwociom wykazuje si take odpornoci na dziaanie takich substancji jak: ywno, tuszcze, sl, chlor czy alkohol, co gwarantuje dug ywotnoci mebli.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Technorattan do zudzenia imitujcy naturalny rattan jest do atwy w utrzymaniu, poniewa wystarczy przetrze go wycznie wilgotn ciereczk.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">Warto rwnie zwrci uwag na fakt, i meble wykonane z technorattanu s wielosezonowe. Charakteryzuj si wysok elastycznoci i odpornoci na rozciganie. W skadzie chemicznym technorattanu nie wystpuj substancje toksyczne, przez co s przyjazne rodowisku i 100% poddaj si recyklingowi.</span></div>
<div style=\"text-align: justify;\"><span style=\"font-family: Verdana;\">&nbsp;</span></div>', '', '', '92', 'Leanka Sun ze stolikiem', 'Wysokiej klasy leanka ogrodowa wraz ze stolikiem. Zapraszamy na nasz stron!', 'leaki ogrodowe, leaki drewniane, leaki do ogrodu, leaki z rattanu, leaki technorattan, hamaki ogrodowe, hamaki do ogrodu, hamaki drewniane', '');
