drop table if exists tw_zmiany_klienci;
create table tw_zmiany_klienci (
  id_klienta int(11) default '0' not null ,
  typ_zmiany tinyint(4) default '0' not null 
);

drop table if exists tw_zmiany_zamowienia;
create table tw_zmiany_zamowienia (
  id_zamowienia int(11) default '0' not null ,
  typ_zmiany tinyint(4) default '0' not null ,
  PRIMARY KEY (id_zamowienia)
);

drop table if exists whos_online;
create table whos_online (
  customer_id int(11) not null ,
  full_name varchar(64) not null ,
  session_id varchar(128) not null ,
  ip_address varchar(15) not null ,
  time_entry varchar(14) not null ,
  time_last_click varchar(14) not null ,
  last_page_url text not null ,
  http_referer varchar(255) not null ,
  user_agent varchar(255) not null ,
  PRIMARY KEY (session_id)
);

drop table if exists zones;
create table zones (
  zone_id int(11) not null auto_increment,
  zone_country_id int(11) not null ,
  zone_code varchar(32) not null ,
  zone_name varchar(32) not null ,
  PRIMARY KEY (zone_id),
  KEY zone_country_id (zone_country_id),
  KEY zone_name (zone_name),
  KEY zone_code (zone_code),
  KEY idx_zones_to_geo_zones_country_id (zone_country_id)
);

